import React from "react";
import Nav from "../nav/Nav";
import mc from "./header.module.scss";

const Header = () => {
  return (
    <header className={mc.container}>
      <div>
        <h1>ScoreUp</h1>
        <Nav />
      </div>
    </header>
  );
};

export default Header;
